import React, { useEffect, useState } from "react";

import { DataGrid } from "@mui/x-data-grid";
import CircularProgress from "@mui/material/CircularProgress";
import Box from "@mui/material/Box";
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

import { useNavigate } from "react-router-dom";
import axios from "axios";

const columns = [
  {
    field: "id",
    headerName: "ID",
    width: 90,
  },
  { field: "fristName", headerName: "FristName", width: 130 },
  { field: "lastName", headerName: "LastName", width: 130 },
  { field: "age", headerName: "Age", width: 130 },
  {
    field: "email",
    headerName: "email",
    width: 90,
  },
  {
    field: "address",
    headerName: "address",
    width: 160,
  },
];

function Home() {
  const navigate = useNavigate();

  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [name, setName] = useState("");

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"));
    if (!dataRegister) {
      navigate("/register");
    }
    const res = axios.get(
      "https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist"
    );
    res.then((data) => {
      setName(dataRegister.lastName)
      setTimeout(() => {
        setUsers(data.data)
        setLoading(false)
      }, 3000)
    });
  }, []);

  return (
    <>
      <Box>
        {
          name
        }
        <Button variant="contained">Log Out</Button>

      </Box>
      {loading ? (
        <Box sx={{ display: "flex", justifyContent: "center", marginTop: "25%" }}>
          <CircularProgress />
        </Box>
      ) : (
        <div style={{ height: 400, width: "100%" }}>
          <Typography sx={{ textAlign: "center", margin: "50px" }}>List of management users</Typography>
          <DataGrid
            rows={users}
            columns={columns}
            initialState={{
              pagination: {
                paginationModel: { page: 0, pageSize: 5 },
              },
            }}
            pageSizeOptions={[5, 10]}
            checkboxSelection
          />
        </div>
      )}
    </>
  );
}

export default Home;
